import React, { useState } from 'react';
import axios from 'axios'



const Auth = ()=>{
    const [value, setValue] = useState({
        email: '',
        password: ''
      })


    const inputValue = (event) =>{
        const {name, value} = event.target
        setValue((prevData) =>{
          return {...prevData,
            [name] : value}
        })
        
    }


    const Onsubmit = () =>{
        axios.post('http://localhost:8000/auth/login', {
            data : {
                email : 'nilson@email.com',
                password : 'nilson'
            }
          })
          .then((response) => {
            console.log(response);
          }, (error) => {
            console.log(error);
          });
        
    }
    return(
        <>
        <div>
            <input type='text' onChange = {inputValue} value = {value.email} name = "email"></input> <br/>
            <input type='password' onChange = {inputValue} value = {value.password} name = 'password'></input><br/>
           <button onClick = {Onsubmit}>Login</button> 
        </div>
        </>
    )
}


export default Auth;
